import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';

export default function Onboarding() {
  const navigate = useNavigate();
  const [step, setStep] = useState(1);
  const [selectedStep2, setSelectedStep2] = useState('');

  const handleNext = () => {
    if (step === 2 && !selectedStep2) return;
    if (step === 2) localStorage.setItem('onboardingStep2Choice', selectedStep2);
    if (step < 7) setStep(step + 1);
    else navigate('/recommended-jobs');
  };

  const handleBack = () => {
    if (step > 1) setStep(step - 1);
  };

  const renderStepContent = () => {
    switch (step) {
      case 1:
        return (
          <>
            <h2 className="text-xl font-semibold text-gray-900 mb-4">Let's Land Your First Job Faster with AI</h2>
            <p className="text-sm text-gray-500 mb-6">Smart job matching. AI interviews. Instant resume tailoring.</p>
            <div className="mb-6">
              <img
                src="https://img.freepik.com/premium-photo/ai-generated-headshot-portrait-woman_902639-30630.jpg"
                alt="AI Assistant"
                className="rounded-lg w-64 mx-auto"
              />
            </div>
            <button
              onClick={handleNext}
              className="bg-purple-600 hover:bg-purple-700 text-white px-6 py-2 rounded"
            >
              Let's Go
            </button>
          </>
        );

      case 2:
        return (
          <>
            <h2 className="text-xl font-semibold text-gray-900 mb-2">
              What’s Your First Step Toward Success?
            </h2>
            <p className="text-sm text-gray-500 mb-6">
              Whether you're job hunting, practicing interviews, or polishing your resume we’ll guide you every step.
            </p>
            <div className="flex flex-col items-center gap-4 mb-6">
              {['Find My First Job', 'Practice Interviews', 'Build My Resume'].map((label, index) => (
                <label
                  key={index}
                  className={`flex items-center w-72 px-4 py-3 border rounded-lg cursor-pointer text-sm ${
                    selectedStep2 === label
                      ? 'border-purple-600 bg-purple-50 text-purple-700 font-medium'
                      : 'border-gray-300 text-gray-600 hover:border-purple-400'
                  }`}
                >
                  <input
                    type="radio"
                    name="step2option"
                    value={label}
                    checked={selectedStep2 === label}
                    onChange={() => setSelectedStep2(label)}
                    className="mr-3"
                  />
                  {label}
                </label>
              ))}
            </div>
            <div className="flex justify-center gap-4">
              <button
                onClick={handleBack}
                className="px-6 py-2 bg-gray-100 text-gray-800 rounded hover:bg-gray-200"
              >
                Back
              </button>
              <button
                onClick={handleNext}
                disabled={!selectedStep2}
                className={`px-6 py-2 rounded text-white ${
                  selectedStep2 ? 'bg-purple-600 hover:bg-purple-700' : 'bg-purple-300 cursor-not-allowed'
                }`}
              >
                Next
              </button>
            </div>
          </>
        );

      default:
        return (
          <>
            <h2 className="text-xl font-semibold text-gray-900 mb-4">Step {step}</h2>
            <p className="text-sm text-gray-500 mb-6">This is placeholder content for Step {step}.</p>
            <div className="flex justify-center gap-4">
              <button
                onClick={handleBack}
                className="px-6 py-2 bg-gray-100 text-gray-800 rounded hover:bg-gray-200"
              >
                Back
              </button>
              <button
                onClick={handleNext}
                className="px-6 py-2 bg-purple-600 hover:bg-purple-700 text-white rounded"
              >
                Next
              </button>
            </div>
          </>
        );
    }
  };

  return (
    <div className="min-h-screen bg-white flex flex-col items-center py-12 px-4">
      {/* Logo */}
      <div className="mb-10 text-center">
        <h1 className="text-2xl font-bold text-purple-600">
          Launch<span className="text-gray-900">Hire</span>
        </h1>
      </div>
      <div className="w-full max-w-xl text-center">
        {renderStepContent()}
      </div>
    </div>
  );
}
